import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    width: theme.breakpoints.values.lg,
    maxWidth: '100%',
    margin: '0 auto',
    padding: theme.spacing(3),
  },
}));

function SkinCare() {
  return (
    <div>
      <h1>Header</h1>
    </div>
  );
}

export default SkinCare;
